INSERT INTO `noticias` (`id`, `usuario`, `noticia`, `timestamp`) VALUES
	(1, 'PHB', 'Para abrir um ticket de suporte, clique <a target="_blank" href="http://cliente.galaxyservers.com.br/clientarea.php">aqui</a> para acessar a Ã¡rea cliente no nosso site.', '1523587701'),
	(2, 'PHB', 'A cÃ¢mera e thumbnail estÃ£o temporariamente em manutenÃ§Ã£o.', '1523906860'),
	(3, 'PHB', 'A manutenÃ§Ã£o e migraÃ§Ã£o foi finalizada, agora nÃ£o serÃ¡ necessÃ¡rio dois painÃ©is, estamos fazendo de tudo para compactar em um painel sÃ³, vocÃª jÃ¡ pode gerenciar o banco de dados, arquivos (file manager e ftp), emulador e swf por aqui.', '1524099176'),
	(4, 'PHB', 'Foram adicionadas as funÃ§Ãµes: Configurar CMS, Reinstalar Banco de dados, Reinstalar CMS e Acesso FTP ao painel.', '1524101476'),
	(5, 'PHB', 'Agora vocÃª poderÃ¡ reinstalar sua cÃ¢mera atravÃ©s do painel, o phpMyAdmin foi arrumado e agora estÃ¡ mais estÃ¡vel e rÃ¡pido.', '1524320687'),
	(7, 'PHB', 'Iremos reiniciar nosso servidor Ã s 00:00 do dia 26/04! isso serÃ¡ para resolver algumas pendÃªncias. a reinicializaÃ§Ã£o e re-ligamento de tudo demora cerca de 10 minutos.', '1524785941'),
	(8, 'PHB', 'ReinicializaÃ§Ã£o e atualizaÃ§Ã£o realizada, foi adicionado um novo comando :pay, e algumas correÃ§Ãµes.', '1524810005'),
	(9, 'PHB', 'VÃ¡rias atualizaÃ§Ãµes :)<br>Painel atualizado para versÃ£o 2.0! Foram adicionada as funÃ§Ãµes: Adicionar LTD, Dar Rank, Emblemas Game. AlÃ©m de mais duas CMS adicionadas!<br>O Emulador tambÃ©m foi atualizado, com uma nova pathfinder e uma nova bola, o mod tools tambÃ©m foi fixado.', '1525240083'),
	(10, 'PHB', 'Agora vocÃª pode alterar o rank mÃ­nimo para usar os comandos pelo painel! VÃ¡ em Extras>Comandos e edite os necessÃ¡rios!', '1525496874'),
	(11, 'PHB', 'Emblemas de cabeÃ§a fixados, efeito que saia apÃ³s executar aÃ§Ã£o fixado, comando :disco fixado, comandos :selfie e :controlabot adicionados.', '1525496972'),
	(12, 'PHB', 'AtualizaÃ§Ãµes realizadas nessa madruga, foram corrigidos o chat vip, comandos, floor e outros...', '1525590504'),
	(13, 'PHB', 'Em instantes serÃ¡ realizada uma atualizaÃ§Ã£o no emulador com vÃ¡rias novidades', '1526082383'),
	(14, 'PHB', 'AtualizaÃ§Ãµes da madrugada! Loteria adicionada ao hotel, em especiais no catÃ¡logo, foi adicionado tambÃ©m a premiaÃ§Ã£o diÃ¡ria (comeÃ§arÃ¡ a funcionar apartir de amanhÃ£) e os comandos :aq, :fq, :mobi, :loteria, alÃ©m de diversos bugs arrumados.', '1526108156'),
	(15, 'PHB', 'AtualizaÃ§Ã£o na Ã¡rea! visuais atualizados, algumas correÃ§Ãµes e um comando novo (:removemobi)', '1526481224'),
	(16, 'PHB', 'AtualizaÃ§Ãµes recentes: slotmachine fixada (os logs vocÃª poderÃ¡ ver na tabela logs_slotmachine), alguns bugs fixados, packs de quartos fixados, entre outras correÃ§Ãµes insignificantes...', '1527223706'),
	(17, 'PHB', 'Agora vocÃª pode alterar a imagem do eventalert (:eha), clique <a href="http://painel.galaxyservers.com.br/imagem-eha">aqui</a>. ', '1527457888'),
	(18, 'PHB', 'AtualizaÃ§Ãµes recentes: Agora vocÃª pode cavalgar! todos os usuÃ¡rios com rank acima de 1, tem o horÃ¡rio de entrada e saida salvos no banco de dados nas tabelas "client_staff_enter" e "client_staff_quit", a ZeusCMS recebeu mais uma atualizaÃ§Ã£o, o painel recebeu uma nova versÃ£o, com uma nova categoria de tutoriais aonde serÃ¡ postado vÃ¡rias coisas legais lÃ¡, agora vocÃª pode limpar os logs do emulador, dentre outras correÃ§Ãµes.', '1527653637'),
	(19, 'PHB', 'O cat&aacute;logo est&aacute; sendo atualizado, nova categoria &quot;Quadros de parede&quot;&nbsp; em mob&iacute;lias b&aacute;sicas e novo mobi ger&aacute;vel em c&acirc;mbios.\r\n&nbsp;', '1527817368'),
	(21, 'PHB', 'Um novo domÃ­nio foi adicionado ao painel: galaxypanel.top, a pÃ¡gina de configuraÃ§Ã£o do emulador serÃ¡ removida amanhÃ£ para manutenÃ§Ã£o, agora estamos vendendo streaming por um preÃ§o acessÃ­vel, acesse: http://cliente.galaxyservers.com.br/cart.php?gid=4', '1528426976'),
	(22, 'PHB', 'Painel atualizado! Ãrea de configuraÃ§Ãµes do emulador refeita, agora vocÃª pode aplicar o emblema de game apertando um simples botÃ£o, sem precisar reiniciar o emulador, entre vÃ¡rias correÃ§Ãµes.', '1528520479'),
	(23, 'PHB', 'Iremos fazer uma manutenÃ§Ã£o de emergÃªncia, ela terÃ¡ inÃ­cio Ã s 23:00 de brasÃ­lia e tem tÃ©rmino estimado de 1h da manhÃ£!', '1528928471'),
	(24, 'PHB', 'Agora voc&ecirc; pode apagar emblemas hospedados! eles s&atilde;o apagados do servidor e dos usu&aacute;rios e pode ser usado o mesmo c&oacute;digo novamente para hospedar outro emblema.', '1529183792'),
	(25, 'PHB', 'Agora temos uma api pr&oacute;pria para as ads, caso voc&ecirc; esteja tendo problemas com as suas, hospede pelo nosso painel.', '1529197196'),
	(27, 'PHB', 'Agora voc&ecirc; pode hospedar &iacute;cones personalizados para o cat&aacute;logo! acesse &quot;Hospedar &iacute;cone cat&aacute;logo&quot; no menu extras.', '1529204015'),
	(28, 'PHB', 'As 3 CMS foram atualizadas, atualiza&ccedil;&otilde;es na seguran&ccedil;a, fix no sso e HK, o GalaxyPanel acaba de receber uma nova atualiza&ccedil;&atilde;o, amanh&atilde; todos os emuladores v&atilde;o ser reiniciados na madrugada (entre 00:00 e 1:00) para uma atualiza&ccedil;&atilde;o.&nbsp;', '1529464640'),
	(29, 'PHB', 'Estamos preparando atualiza&ccedil;&otilde;es para o cat&aacute;logo e jukebox.', '1529777423'),
	(30, 'PHB', 'Nova CMS dispon&iacute;vel no painel, nomeada &quot;Cabbo CMS&quot;, foi criada por n&oacute;s, feita em base Brain, pesando apenas 3MB e com um design retr&ocirc;, &eacute; uma boa op&ccedil;&atilde;o de cms!&nbsp;Confira aqui:&nbsp;http://sandbox.galaxyservers.com.br/.&nbsp;', '1529888752'),
	(31, 'PHB', 'Foi adicionado uma nova cms, a cms do habbo br, caso seja encontrado algum erro, nos contate pelo chat.', '1530067134'),
	(32, 'PHB', 'Foi adicionada a &quot;Perl CMS&quot; e uma edi&ccedil;&atilde;o da Zeus CMS com tema Gal&aacute;xia! em breve mais cms! caso voc&ecirc; tenha alguma CMS bonita envie para n&oacute;s.', '1530572846'),
	(33, 'PHB', '&nbsp;Nova CMS adicionada! rCrystal.', '1530829107'),
	(37, 'PHB', '<p>Agora voc&ecirc; pode instalar automaticamente e instantaneamente o player da r&aacute;dio em seu hotel! a fun&ccedil;&atilde;o &eacute; compat&iacute;vel somente com as cms&#39;s&nbsp;disponibilizadas por n&oacute;s. Clique&nbsp;<a href="https://galaxypanel.top/player-radio">aqui</a>&nbsp;para conferir essa novidade. Infelizmente o player &eacute; compat&iacute;vel apenas com&nbsp; o Shoutcast v2, caso deseja adquirir um Streaming compat&iacute;vel, clique <a href="http://cliente.galaxyservers.com.br/cart.php?gid=4" target="_blank">aqui</a>.</p>\r\n', '1530906623'),
	(38, 'PHB', '<p style="text-align:center"><span style="font-size:16px"><span style="font-family:Comic Sans MS,cursive">Nova CMS adicionada! HMOON CMS 2.0!</span></span></p>\r\n\r\n<p style="text-align:center"><img src="https://i.imgur.com/88Gs4IL.png" /></p>\r\n\r\n<p style="text-align:center">&nbsp;</p>\r\n', '1530992913'),
	(39, 'PHB', '<p style="text-align:center">Tivemos uma atualiza&ccedil;&atilde;o em nossa SWF, aonde foi removida o &iacute;cone de Games, Tarefas e Clube do Arquiteto, deixando bem mais clean e tamb&eacute;m foi adicionada bolhas para staffs!<br />\r\nEssa atualiza&ccedil;&atilde;o &eacute; opcional para os clientes atuais, pois para a instala&ccedil;&atilde;o dela ir&aacute; resetar as altera&ccedil;&otilde;es realizadas na Habbo.swf (troca de &iacute;cone e etc), caso voc&ecirc; queira que a sua SWF seja atualizada, dever&aacute; solicitar atrav&eacute;s de ticket, chat ou WhatsApp!</p>\r\n\r\n<p style="text-align:center"><img src="https://i.imgur.com/9KMwy6k.png" style="height:50%; width:50%" /></p>\r\n', '1531098996'),
	(40, 'PHB', '<p style="text-align:center"><span style="font-size:18px"><span style="font-family:Comic Sans MS,cursive">Nova CMS adicionada! Habblive CMS.</span></span></p>\r\n\r\n<p style="text-align:center"><img src="https://i.imgur.com/OHIM1wL.png" /></p>\r\n', '1531149760'),
	(41, 'PHB', '<p>Os bot&otilde;es de ligar/desligar/reiniciar emulador foram otimizados, agora ele tratar&aacute; melhor os erros e n&atilde;o ir&aacute; falar que o emulador est&aacute; ligado quando estiver desligado.</p>\r\n', '1531157710'),
	(42, 'PHB', '<p style="text-align:center"><img src="https://i.imgur.com/JMEW1HM.png" />Os visuais foram atualizados, talvez demore para aparecer.</p>\r\n', '1531197938'),
	(43, 'PHB', '<p>Agora voc&ecirc; pode usar :enable e :efeito para ativar efeitos e :emptyitems e :empty para zerar o invent&aacute;rio, ambos tem a mesma permiss&atilde;o, ent&atilde;o, para a edi&ccedil;&atilde;o&nbsp;n&atilde;o &eacute; necess&aacute;rio alterar separadamente, pois &eacute; o mesmo comando com &quot;chamadas&quot; diferentes.<img src="https://i.imgur.com/xJE0nim.png" style="float:right" /></p>\r\n\r\n<p>Foi adicionado tamb&eacute;m o par&acirc;metro &quot;user&quot; no comando :emoji, podendo ser usado assim:&nbsp;&quot;:emoji user PHB&quot;</p>\r\n', '1531213327'),
	(44, 'PHB', '<p>Ao ver os problemas enfrentados pelo beeimg, n&oacute;s estamos desenvolvendo um site para hospedagem de ADS, o mesmo ter&aacute; uma API p&uacute;blica para por no HK, e ser&aacute; de uso p&uacute;blico, ficar&aacute; alojado em um servidor brasileiro, em breve estar&aacute; online!</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1531250175'),
	(45, 'PHB', '<p>Ao ver os problemas enfrentados pelo beeimg, hoje estamos lan&ccedil;ando nosso pr&oacute;prio site de hospedagem de ADS, dispon&iacute;vel para o p&uacute;blico, sem limites de tamanho de imagem e sem propagandas!<br />\r\nAcesse j&aacute; e teste agora mesmo:&nbsp;<a href="http://galaxyads.top/" rel="noopener nofollow" target="_blank">http://galaxyads.top/</a><br />\r\nAinda estamos em fase beta, qualquer erro nos comunique no privado.</p>\r\n', '1531258473'),
	(46, 'PHB', '<p>Pe&ccedil;o desculpas pelo ocorrido, n&atilde;o sei o que aconteceu, o windows update ativou sozinho e reiniciou a m&aacute;quina para instalar atualiza&ccedil;&otilde;es.</p>\r\n', '1531319830'),
	(47, 'PHB', '<p>iremos fazer uma reinicializa&ccedil;&atilde;o em breve.</p>\r\n', '1531364792'),
	(48, 'PHB', '<p>Por alguns problemas no nosso servidor da Hostdime, nessa madrugada estaremos fazendo a migra&ccedil;&atilde;o do nosso site principal e da nossa SWF para outro servidor, pe&ccedil;o que n&atilde;o usem qualquer fun&ccedil;&atilde;o que envolva uploads (emblemas, eha, swf, icone) pois tudo que ser&aacute; adicionado de 12:30 at&eacute; o fim da migra&ccedil;&atilde;o ser&aacute; perdido. Nenhum hotel ficar&aacute; offline.</p>\r\n', '1531451198'),
	(49, 'PHB', '<p>Manuten&ccedil;&atilde;o na SWF realizada, creio que ningu&eacute;m percebeu kkkk.</p>\r\n', '1531454941'),
	(50, 'PHB', '<p>Foram corrigidas algumas falhas de tanji e um bug nos grupos.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1531634645'),
	(51, 'PHB', '<p>Iremos fazer uma manuten&ccedil;&atilde;o em breve, ir&aacute; come&ccedil;ar as 23:00.</p>\r\n', '1531777805'),
	(52, 'PHB', '<p>Por conta de problemas provavelmente a manuten&ccedil;&atilde;o ser&aacute; adiada.</p>\r\n', '1531780071'),
	(53, 'PHB', '<p>Manuten&ccedil;&atilde;o realizada!</p>\r\n', '1531782126'),
	(55, 'PHB', '<p>Atualiza&ccedil;&atilde;o feita!</p>\r\n\r\n<p>Corre&ccedil;&otilde;es feitas no cat&aacute;logo, foi adicionado um c&oacute;digo no emulador que ser&aacute; executado de 10 em 10 segundos que apagar&aacute; not&iacute;cias que tem script de redirecionamento! n&atilde;o se preocupe mais com moderadores babacas postando not&iacute;cias com scripts redirecionando para outros hot&eacute;is.</p>\r\n', '1532152718'),
	(56, 'PHB', '<p>Foi adicionado adiantado a primeira&nbsp;cms do m&ecirc;s 8, l&aacute; para o dia 15 voltaremos com mais uma cms!</p>\r\n', '1532489499'),
	(57, 'PHB', '<p>Importante: Para toda a equipe de seu hotel, n&atilde;o use a mesma senha em outros hot&eacute;is, direto recebemos reclama&ccedil;&otilde;es de pessoas &quot;invadindo&quot; hot&eacute;is, mas n&oacute;s n&atilde;o podemos fazer nada, pois caso voc&ecirc; se registra em um hotel com a sua senha, eles tem ela l&aacute;, podem usar para logar na sua conta com rank em outro hotel. Tome bastante cuidado e tenha uma senha &uacute;nica sempre!</p>\r\n', '1532659936'),
	(58, 'PHB', '<p>Prepare suas imagens, agora voc&ecirc; pode&nbsp;mudar seu fundo da client, nossa fun&ccedil;&atilde;o ainda est&aacute; em fase beta, caso queira testar acesse diretamente pelo link:&nbsp;<a href="http://galaxypanel.top/vista-client">http://galaxypanel.top/vista-client</a></p>\r\n\r\n<p>Caso voc&ecirc; tenha problemas com a fun&ccedil;&atilde;o nos avise!</p>\r\n', '1532722529'),
	(59, 'PHB', '<p>Em breve ser&aacute; adicionado em nosso emulador o :loginstaff!</p>\r\n\r\n<p>O uso ser&aacute; obrigat&oacute;rio, n&atilde;o ter&aacute; como desativar, isso &eacute; uma medida dr&aacute;stica de seguran&ccedil;a que estamos tomando para melhorar nossos servi&ccedil;os.</p>\r\n\r\n<p>O pin ser&aacute; padr&atilde;o como 0000, o mesmo poder&aacute; ser alterado na tabela users, iremos colocar uma fun&ccedil;&atilde;o no GalaxyPanel para alterar o pin tamb&eacute;m!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tempo m&eacute;dio: 2-3 dias.</p>\r\n', '1532831051'),
	(60, 'PHB', '<p>N&oacute;s nunca pedimos dados de clientes, nunca passe dados, v&aacute;rias pessoas j&aacute; pegaram dados se passando por n&oacute;s. Tome cuidado!</p>\r\n', '1532896452'),
	(61, 'PHB', '<p><span style="font-size:16px"><strong>Aten&ccedil;&atilde;o!!</strong></span><br />\r\nAmanh&atilde; as 00:00 (dia 31) ser&aacute; realizada uma reinicializa&ccedil;&atilde;o para a atualiza&ccedil;&atilde;o do emulador, ser&aacute; implantado o :loginstaff, pe&ccedil;o que j&aacute; v&atilde;o configurando atrav&eacute;s da p&aacute;gina &quot;<a href="http://galaxypanel.top/pinstaff">Senha login staff</a>&quot; e j&aacute; passe as informa&ccedil;&otilde;es para sua equipe, para evitar problemas.</p>\r\n\r\n<p>J&aacute; estamos trabalhando na nova cms que ser&aacute; lan&ccedil;ada daqui h&aacute; alguns dias, nossa id&eacute;ia &eacute; por as 2 cms esse m&ecirc;s e atualizar todas as outras com as novas funcionalidades, ela ter&aacute; link de quarto 100% (ambos os links) e tamb&eacute;m tem um log do hk, mostrando a&ccedil;&otilde;es de staffs (em breve nas cms atuais)</p>\r\n\r\n<p style="text-align:center"><img src="https://i.imgur.com/iH8SmqR.png" style="height:147px; width:300px" /><img src="https://i.imgur.com/hS7Yytj.png" style="height:146px; width:300px" /></p>\r\n', '1533005641'),
	(62, 'PHB', '<p>Atualiza&ccedil;&otilde;es de hoje:<br />\r\nFoi adicionado o :loginstaff ao emulador<br />\r\nFoi adicionado uma nova CMS ao painel<br />\r\nFoi fixado o link de quarto em todas as cms do painel<br />\r\nFoi fixada falhas conhecidas em todas as cms<br />\r\nFoi resolvido o problema do player da r&aacute;dio que n&atilde;o instalava na cms do Habbo BR<br />\r\nFoi adicionado log do HK<br />\r\nFoi adicionado like em not&iacute;cia em todas as cms</p>\r\n\r\n<p>Recomendamos a reinstala&ccedil;&atilde;o da CMS!<br />\r\nA cms veio mais cedo esse m&ecirc;s, era para ser lan&ccedil;ado a Pixeled hoje e a Habbie no dia 15!</p>\r\n\r\n<p>Recomendamos tamb&eacute;m sempre reiniciar seu emulador, n&atilde;o deixe ele mais de dois dias sem reiniciar, isso pode fazer o consumo de cache dele ficar alto demais, e fazer dar um pouco de delay.</p>\r\n\r\n<p>At&eacute; a proxima atualiza&ccedil;&atilde;o!</p>\r\n', '1533093327'),
	(63, 'PHB', '<p>Iremos fazer uma reinicializa&ccedil;&atilde;o de emerg&ecirc;ncia hoje para arrumar o problema do :loginstaff com embaixadores, ser&aacute; as 11:30.</p>\r\n', '1533170155'),
	(64, 'PHB', '<p>Ser&aacute; feita uma reinicializa&ccedil;&atilde;o hoje &agrave;s 23h para arrumar o problema do loginstaff para embaixadores.</p>\r\n', '1533243888'),
	(65, 'PHB', '<p>Iremos fazer uma manuten&ccedil;&atilde;o, iniciando as 23:30 para resolver o problema do erro 403 que aparece &agrave;s vezes, aparentemente a manuten&ccedil;&atilde;o &eacute; simples e n&atilde;o ser&aacute; necess&aacute;rio desligar o hotel ou deixar offline. pe&ccedil;o desculpas pelo ocorrido.</p>\r\n', '1533338993'),
	(67, 'b3ta', '<p>Agora voc&ecirc; pode fazer o download de backups de seu hotel, que &eacute; criado automaticamente todos os dias pelo nosso sistema. Inclui database e arquivos compactados.&nbsp;<a href="http://galaxypanel.top/backups">http://galaxypanel.top/backups</a></p>\r\n', '1533450833'),
	(68, 'b3ta', '<p>Tr&ecirc;s (3) novas fun&ccedil;&otilde;es foram adicionadas:<br />\r\nAtivar/Desativar Manuten&ccedil;&atilde;o - Ative&nbsp;ou desative&nbsp;a manuten&ccedil;&atilde;o do hotel pelo bot&atilde;o na Home do GalaxyPanel;<br />\r\nEnvie qualquer m&uacute;sica para a Jukebox atrav&eacute;s do GalaxyPanel;<br />\r\nEsqueceu sua senha? Clique em &quot;Esqueci a senha&quot; e voc&ecirc; receber&aacute; um e-mail com os seus dados de acesso do GalaxyPanel.</p>\r\n', '1533506487'),
	(69, 'PHB', '<p>Agora voc&ecirc; pode colocar uma mensagem de bem vindo em seu hotel!</p>\r\n\r\n<p>Acesse j&aacute;:<a href="http://galaxypanel.top/bemvindo">&nbsp;http://galaxypanel.top/bemvindo</a></p>\r\n', '1533528679'),
	(70, 'PHB', '<p>Lan&ccedil;amos a extens&atilde;o do GalaxyPanel para o Google Chrome!</p>\r\n\r\n<p>Confira clicando <a href="https://cliente.galaxyservers.com.br/announcements/2/Extensao-do-GalaxyPanel-para-o-Chrome.html">aqui</a>.</p>\r\n\r\n<p><img src="https://i.imgur.com/qQdYkoZ.png" style="height:155px; width:300px" /></p>\r\n', '1534530741'),
	(71, 'PHB', '<p>Meu discord original &eacute; PHB#3022, n&oacute;s da Galaxy nunca pedimos nenhum dados de nossos clientes, nunca passe nada a ningu&eacute;m.</p>\r\n', '1534555842'),
	(73, 'PHB', '<p>Entre j&aacute; no discord oficial da GalaxyServers clicando <a href="https://discord.gg/UmjFxE2">aqui</a>.</p>\r\n', '1534644372'),
	(74, 'PHB', '<p>O phpMyAdmin foi fixado e atualizado!</p>\r\n', '1534881069'),
	(75, 'PHB', '<p>Iremos reiniciar nosso servidor hoje, &agrave;s 23:00 para uma r&aacute;pida manuten&ccedil;&atilde;o!</p>\r\n', '1535297716'),
	(76, 'PHB', '<p>Manuten&ccedil;&atilde;o mensal para reinicializa&ccedil;&atilde;o do servidor realizada, o comando :handitem foi arrumado tamb&eacute;m! M&ecirc;s que vem tem denovo.</p>\r\n', '1535349577'),
	(77, 'PHB', '<p>Come&ccedil;ei a preparar uma atualiza&ccedil;&atilde;o para o cat&aacute;logo e efeitos, isso &eacute; um trabalho exaustivo, por isso ficarei ausente por um tempo, contem somente com o b3ta temporariamente.</p>\r\n', '1536003002'),
	(78, 'PHB', '<p>Todos os cat&aacute;logos foram atualizados.</p>\r\n\r\n<p>Novas p&aacute;ginas: Ween 18, Zen 18 e Hotel 2018.</p>\r\n', '1536202402'),
	(80, 'PHB', '<p>Voc&ecirc; agora pode mudar a senha do painel pelo GalaxyPanel em Gerenciamento &gt; Alterar Senha.</p>\r\n', '1537131464'),
	(81, 'PHB', '<p>Agora voc&ecirc; pode hospedar imagens personalizadas para o cat&aacute;logo!<br />\r\nAcesse:&nbsp;<a href="https://galaxypanel.top/hospedar-imagem-catalogo">https://galaxypanel.top/hospedar-imagem-catalogo</a></p>\r\n\r\n<p>Ao hospedar, ir&aacute; gerar um c&oacute;digo, coloque ele Strings 1 no cat&aacute;logo<br />\r\nCada p&aacute;gina pode ser colocada at&eacute; duas imagens, uma encima, uma em baixo, voc&ecirc; dever&aacute; colocar o seguinte no Strings 1:<br />\r\nimagemcima|imagembaixo<br />\r\nO C&oacute;digo das duas imagens, separadas por um |, sem espa&ccedil;os! Ap&oacute;s isso d&ecirc; :update cata para atualizar!</p>\r\n', '1537409319'),
	(82, 'PHB', '<p>Agora voc&ecirc; pode hospedar imagem para o server_landing!</p>\r\n', '1538333419'),
	(83, 'PHB', '<p><img src="https://i.imgur.com/BmCq8BD.png" style="float:right; height:168px; margin-left:180px; margin-right:180px; width:150px" /></p>\r\n\r\n<p>Agora voc&ecirc; pode hospedar imagens para a frontpage de seu hotel!<br />\r\nConfira essa novidade clicando <a href="http://galaxypanel.top/frontpage">aqui</a>.<br />\r\nAgradecimentos especiais para o&nbsp;Hazys do <a href="http://crazyhotel.me">Crazy Hotel</a>.</p>\r\n', '1541969463'),
	(84, 'PHB', '<p>Agora temos o Galaxy FAQ!<br />\r\nNele, voc&ecirc; pode sanar varias d&uacute;vidas, sem precisar abrir ticket!<br />\r\nAcesse j&aacute;:&nbsp;https://faq.galaxyservers.com.br/</p>\r\n', '1546024850'),
	(85, 'PHB', '<p>Foi realizada uma atualiza&ccedil;&atilde;o no emulador!<br />\r\nCorre&ccedil;&otilde;es: Premia&ccedil;&atilde;o de tempo on e alguns comandos com loginstaff removidos.<br />\r\nFoi adicionado a fun&ccedil;&atilde;o de imagem ao logar no hotel, entre nas configura&ccedil;&otilde;es do emulador para colocar a sua.</p>\r\n', '1546502799'),
	(86, 'PHB', '<p><img src="https://i.imgur.com/JD4Bhvh.png" style="float:right" /></p>\r\n\r\n<p>Foi adicionado no painel o t&atilde;o esperado gerenciador de raros ltd, com ele voc&ecirc; pode editar e apagar raros do seu cat&aacute;logo!<br />\r\nA p&aacute;gina de upload de ltd tamb&eacute;m foi movida no menu para Gerenciamentos &gt; Raros.&nbsp;</p>\r\n', '1549650494'),
	(87, 'PHB', '<p>A fun&ccedil;&atilde;o &quot;Configurar CMS&quot; foi refeita! agora voc&ecirc; pode editar o logo, moedas iniciais, facebook e outros por ela.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '1550687741'),
	(88, 'PHB', '<p>Foram realizadas todas as atualiza&ccedil;&otilde;es!<br />\r\nOs visuais foram atualizados, estamos com os mesmos do Habblive.<br />\r\nA vista da client padr&atilde;o foi atualizada para a da banda.<br />\r\nOs mobis foram atualizados, novas categorias: Banda 2019, Valentim 2019,&nbsp;Hygge 2019, Porco chin&ecirc;s e HC 2019<br />\r\nTamb&eacute;m foram adicionados mais dois mobis na categoria &quot;Moedas&quot;.</p>\r\n\r\n<p>A Habblive CMS foi corrigida, agora voc&ecirc; pode trocar a logo facilmente pelo configurar cms. (para que tenha efeito reinstale).</p>\r\n', '1551645342'),
	(89, 'PHB', '<p>Os novos mobis do Habbo BR foram adicionado ao servidor, ser&aacute; adicionado aos hot&eacute;is gradualmente.<br />\r\nA vista da client padr&atilde;o foi atualizada.<br />\r\nNovas categorias de mobis: Greek 2019 e Fest 2019</p>\r\n', '1557098222');
