INSERT INTO `tutoriais` (`id`, `user`, `titulo`, `post`, `data`) VALUES
	(8, 'PHB', 'Adicionando emblemas no catÃ¡logo.', '<p>Tutorial em slides, passo &agrave; passo.<br />\r\nPara ver clique <a href="https://drive.google.com/file/d/1sEHp222EZ63pHUgmvy8typELfjJQvnHp/view" onclick="window.open(this.href, \'\', \'resizable=no,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=no,width=800,height=500\'); return false;">aqui</a>.</p>\r\n', 1527637963),
	(9, 'PHB', 'Como adicionar packs de quarto no catÃ¡logo', 'Um tutorial bastante pedido por voc&ecirc;s, agora em slides.\r\nhttps://drive.google.com/file/d/1e4qGHXIg8I3jqvT9c-boK_0Jdh0FcwEU/view?usp=sharing', 1530374316),
	(10, 'PHB', 'Adicionando raros ltd', 'Um tutorial f&aacute;cil, por&eacute;m complicado de entender para novos na &aacute;rea..&nbsp;\r\n\r\nhttps://drive.google.com/file/d/1kMJQMuQF0bTvEq3A3pJToyu-mMRpwUXF/view?usp=sharing', 1530748115),
